import React, { useContext } from 'react';

import { SharedStateContext } from './_SharedStateComponent';

export default function AppletActiveClientPersonas() {

	const { currentClient } = useContext(SharedStateContext);

	const personas = JSON.parse(currentClient.personas);

	if (!personas || personas.length === 0) {
		return <div>No personas available.</div>;
	}

	const personaMap = () => personas.map(persona => (

		<div key={persona.id} className="view-wrapper persona container">
			
			{/* Persona Header */}
			<h3><strong>{persona.name}</strong>: {persona.examples}</h3>
			<p>{persona.personaSummary}</p>
			
			{/* Persona Content */}
			<div className="row">

				{/* Section 01 */}
				<div className="col-12">
					<div className="row">

						{/* Overview */}
						<div className="col-6">
							<h4>Overview:</h4>
							<p><strong>Industry Summary:</strong> {persona.industrySummary}</p>
							<p><strong>Services:</strong> {persona.services}</p>
						</div>

					</div>
				</div>

				{/* Section 02 */}
				<div className="col-12">
					<div className="row">

						{/* Competitors */}
						<h4>Competitors:</h4>
							

						{persona.competitors.map((competitor, index) => (

							<div key={index} className="col-6">
								<h5>{competitor.name}</h5>
								<p>{competitor.description} </p>
								<ul>
									<li><em>Pros:</em> {competitor.pros}</li>
									<li><em>Cons:</em> {competitor.cons}</li>
								</ul>
								
							</div>

						))}
							
					</div>
				</div>

				{/* Section 03 */}
				<div className="col-12">
					<div className="row">

						{/* Content Areas */}
						<h4>Content Areas:</h4>

						{persona.contentAreas.map((area, index) => (
							
							<div key={index} className="col-4">
								<h5>{area.name}</h5>
								<ul>
									{area.examples.map((example, exIndex) => (
										<li key={exIndex}>{example}</li>
									))}
								</ul>
							</div>
						))}
							
					</div>
				</div>


			</div>
		</div>

	))

	return (
		<>
			{/* Window for Target Personas */}
			<div id="tabcontent-personas" className="view-window row tabcontent">

				{/* Header Section */}
				<div className="view-header col-12">
					<h2>Target Personas Overview</h2>
				</div>

				{personaMap()}

			</div>
		</>
	);
}
